// 리턴값으로 태그를 뱉어내는 함수
function Hello() {
  //컴포넌트는 대문자로 시작하게 짓고 함수도 똑같이 맞추기
  return <h1>HELLO!</h1>;
}

function f02() {
  return <h1>REACT</h1>;
}

function f03() {
  return <h1>WORLD</h1>;
}

// 함수 내보내기
export default Hello;
